import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';
import { logout } from '../../../actions/UserAction';
import './EmployeeHome.css'

const EmployeeHome = () => {

  const dispatch = useDispatch();
  const navigate = useNavigate();
  const user = useSelector((state) => state.user);
  console.log(user);

  
  // dispatch(logout());
  useEffect(() => {
    if (!user?.userInfo) {
      navigate('/login')
    }
    if (user?.userInfo?.userType === 'employer' ) {
      navigate('/employer/home')
    }
    if (user?.userInfo?.userType === "admin") {
      navigate("/admin/profile");
    }
  }, [user, dispatch])

  return (
    <div className='employeeHome'>
    <div className="employeehome-div">
     <div className="left">

     <div className="ltop">
     <h4>Monday, september 24th</h4>
     <h3>Welcome back {user?.userInfo?.name}</h3>
     </div>

     <div className="lbottom">

     </div>

     </div>

     <div className="right">
     <div className="r-top">

     </div>
     <div className="r-bottom">

     </div>
     </div>
     </div>
    </div>
  )
}

export default EmployeeHome
